import axios from 'axios';

export const UserRegistration = (d) => {

    const data = JSON.stringify({
        "Username":Username,
        "Email": Email,
        "Password": Password,        
        });

    return axios.post('http://localhost:4000/users/register',data)
        .then(res => res.status);
};
